#ad We had the best mother daughter date at the new @AmericanGirlBrand store inside Westfield Century City in LA. We walked around and did some shopping and checked out all the cuteness for the holidays. After we picked out a few things, we headed to the salon with Elle & her Truly Me doll London for fresh manis and hairstyling. They both looked super cute! We had a little photoshoot then we headed upstairs to check out the cute book section and AG cafe. We ended our date with some yummy food and drinks. It was definitely a day to remember. 

#ad El día de hoy tuvimos la mejor experiencia entre madre e hija en la nueva tienda de 
@AmericanGirlBrand ubicada en Westfield Century City en Los Ángeles . Después de caminar y ver lo más nuevo que tienen para estas fiestas navideñas hicimos un par de compras para luego irnos al Salón donde ya esperaban a Elle y a su muñeca London para hacerse nuevos manicures y peinados , Las dos terminaron viéndose lindisimas , después de ahí tuvimos una sesión de fotos y nos dirigimos al área de café donde tienen una linda librería , terminamos nuestro día de diversión con una deliciosa comida y bebidas , definitivamente fue un dia para recordar .
